import React, { useState, useRef, useEffect } from "react";
import "../Chatbot.css"; // if your css is at src/Chatbot.css
import StarGradient from "../assets/star-gradient.svg";
import FileIcon from "../assets/file-icon.svg";
import BotAvatar from "../assets/bot-avatar.svg";
import SendGradient from "../assets/send-gradient.svg";

export default function Chatbot() {
  const [query, setQuery] = useState("");
  const [messages, setMessages] = useState([
    {
      sender: "bot",
      type: "file",
      filename: "Example File",
      desc: "Downloads",
      size: "500 KB"
    },
    {
      sender: "user",
      type: "text",
      text: "Can you export this as a CSV?"
    },
    {
      sender: "bot",
      type: "text",
      text: "Analyzing data, please wait..."
    }
  ]);
  const chatEndRef = useRef(null);

  useEffect(() => {
    chatEndRef.current?.scrollIntoView({ behavior: "smooth" });
  }, [messages]);

  const suggestions = [
    "Write an email to the marketing team",
    "Summarize key points",
    "Create a follow-up checklist"
  ];
  const [selected, setSelected] = useState(2);

  const send = () => {
    if (!query.trim()) return;
    setMessages([
      ...messages,
      { sender: "user", type: "text", text: query }
    ]);
    setQuery("");
    setTimeout(() => {
      setMessages(m =>
        [...m, { sender: "bot", type: "text", text: "This is a sample AI response." }]
      );
    }, 800);
  };

  return (
    <div className="ai-bg">
      <div className="ai-center-box">
        {/* Star Gradient Icon */}
        <div className="ai-star-circle">
          <img src={StarGradient} alt="Star" width={38} height={38} />
        </div>
        <div className="ai-suggest-label">Asking with AI Suggestions</div>
        <div className="ai-suggestions-vertical">
          {suggestions.map((s, i) => (
            <div
              key={i}
              className={`ai-suggestion-chip ${selected === i ? "selected" : ""}`}
              onClick={() => setSelected(i)}
            >
              {s}
            </div>
          ))}
        </div>
        <div className="ai-chat-history">
          {/* File Card */}
          {messages.map((msg, idx) =>
            msg.type === "file" ? (
              <div key={idx} className="ai-file-card">
                {/* File Icon */}
                <span className="ai-file-icon">
                  <img src={FileIcon} alt="File" width={40} height={40} />
                </span>
                <div>
                  <div className="ai-file-name">{msg.filename}</div>
                  <div className="ai-file-desc">{msg.desc}</div>
                  <div className="ai-file-size">{msg.size}</div>
                </div>
              </div>
            ) : msg.sender === "user" ? (
              <div key={idx} className="ai-bubble user">
                <span>{msg.text}</span>
              </div>
            ) : (
              <div key={idx} className="ai-bubble bot">
                {/* Bot Avatar */}
                <span className="ai-bot-avatar">
                  <img src={BotAvatar} alt="Bot" width={32} height={32} />
                </span>
                <span>{msg.text}</span>
              </div>
            )
          )}
          <div ref={chatEndRef} />
        </div>
        <div className="ai-input-row">
          <input
            type="text"
            placeholder="Ask, write or search for anything..."
            value={query}
            onChange={e => setQuery(e.target.value)}
            onKeyDown={e => e.key === "Enter" && send()}
          />
          <button onClick={send} disabled={!query.trim()} className="ai-send-btn">
            {/* Send Gradient Icon */}
            <img src={SendGradient} alt="Send" width={26} height={26} />
          </button>
        </div>
      </div>
    </div>
  );
}
